import{_ as a,a as o,b as i,c as l,d as n,e as s,f as c,g as h,h as p,i as d,j as m,k as u,l as f,m as g,n as b,o as w,p as P}from"./chunks/qgc_airframe_generic_250_racer.BfY4sqKE.js";import{_}from"./chunks/grau_b_pixracer_frskys.port_connection.B_do80KL.js";import{_ as k,c as v,a8 as e,j as r,o as x}from"./chunks/framework.BDnHobkS.js";const G=JSON.parse('{"title":"Lumenier QAV-R 5\\" Racer (Pixracer)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/qav_r_5_kiss_esc_racer.md","filePath":"uk/frames_multicopter/qav_r_5_kiss_esc_racer.md"}'),S={name:"uk/frames_multicopter/qav_r_5_kiss_esc_racer.md"};function q(y,t,C,A,R,V){return x(),v("div",null,t[0]||(t[0]=[e('<h1 id="lumenier-qav-r-5-racer-pixracer" tabindex="-1">Lumenier QAV-R 5&quot; Racer (Pixracer) <a class="header-anchor" href="#lumenier-qav-r-5-racer-pixracer" aria-label="Permalink to &quot;Lumenier QAV-R 5&quot; Racer (Pixracer)&quot;">​</a></h1><p>Lumenier QAV-R 5&quot; FPV Гоночний квадрокоптер - це жорсткий, легкий та швидкий гоночний квадрокоптер FPV з від&#39;ємними руками. This topic provides full build and configuration instructions for using the frame with the <em>Pixracer</em> flight controller and <em>KISS 24A Race Edition</em> ESCs. Також надає інформацію про (необов&#39;язкове) налаштування FPV.</p><p>Основна Інформація:</p><ul><li><strong>Frame:</strong> <a href="http://www.getfpv.com/qav-r-fpv-racing-quadcopter-5.html" target="_blank" rel="noreferrer">Lumenier QAV-R 5&quot;</a></li><li><strong>Flight controller:</strong> <a href="./../flight_controller/pixracer.html">Pixracer</a></li></ul>',4),r("lite-youtube",{videoid:"wMYgqvsNEwQ",title:"QAV-R 5 PX4 FPV Racequad"},null,-1),e('<p><img src="'+a+'" alt="QAV Racer complete"><img src="'+o+'" alt="QAV Racer complete 2"></p><h2 id="список-деталеи" tabindex="-1">Список деталей <a class="header-anchor" href="#список-деталеи" aria-label="Permalink to &quot;Список деталей&quot;">​</a></h2><h3 id="транспортнии-засіб-потрібнии-для-польоту" tabindex="-1">Транспортний засіб (потрібний для польоту) <a class="header-anchor" href="#транспортнии-засіб-потрібнии-для-польоту" aria-label="Permalink to &quot;Транспортний засіб (потрібний для польоту)&quot;">​</a></h3><ul><li>Autopilot: <a href="./../flight_controller/pixracer.html">Pixracer</a> from <a href="https://store.mrobotics.io/mRo-PixRacer-R14-Official-p/auav-pxrcr-r14-mr.htm" target="_blank" rel="noreferrer">AUAV</a> including ESP8266 WiFi- and <a href="https://store.mrobotics.io/product-p/auav-acsp5-mr.htm" target="_blank" rel="noreferrer">ACSP5</a> power-module</li><li>Frame: <a href="http://www.getfpv.com/qav-r-fpv-racing-quadcopter-5.html" target="_blank" rel="noreferrer">Lumenier QAV-R 5&quot;</a></li><li>Motors: <a href="http://www.getfpv.com/lumenier-rx2206-11-2350kv-motor.html" target="_blank" rel="noreferrer">Lumenier RX2206-11 2350KV</a></li><li>ESCs: <a href="http://www.getfpv.com/kiss-24a-esc-race-edition-32bit-brushless-motor-ctrl.html" target="_blank" rel="noreferrer">KISS 24A Race Edition</a></li><li>Props: HQProp 5x4.5x3 <a href="http://www.getfpv.com/hqprop-5x4-5x3rg-cw-propeller-3-blade-2-pack-green-nylon-glass-fiber.html" target="_blank" rel="noreferrer">CW</a> <a href="http://www.getfpv.com/hqprop-5x4-5x3g-ccw-propeller-3-blade-2-pack-green-nylon-glass-fiber.html" target="_blank" rel="noreferrer">CCW</a></li><li>GPS / Ext. Mag.: M8N taken from a <a href="./../flight_controller/pixhawk_mini.html">Pixhawk Mini (Discontinued)</a> set and rewired</li><li>Battery: <a href="http://www.getfpv.com/tattu-1800mah-4s-75c-lipo-battery.html" target="_blank" rel="noreferrer">TATTU 1800mAh 4s 75c Lipo</a></li><li>RC Receiver: <a href="http://www.getfpv.com/frsky-x4r-sb-3-16-channel-receiver-w-sbus.html" target="_blank" rel="noreferrer">FrSky X4R-SB</a></li><li>RC Transmitter: <a href="http://www.getfpv.com/frsky-taranis-x9d-plus-2-4ghz-accst-radio-w-soft-case-mode-2.html" target="_blank" rel="noreferrer">FrSky Taranis</a></li><li>FC dampening: <a href="http://www.getfpv.com/multipurpose-o-ring-set-of-8.html" target="_blank" rel="noreferrer">O-Rings</a></li><li>GPS Mount: <a href="http://www.getfpv.com/folding-aluminum-gps-mast-for-dji.html" target="_blank" rel="noreferrer">GPS mast</a></li></ul><h3 id="fpv-необов-язково" tabindex="-1">FPV (необов&#39;язково) <a class="header-anchor" href="#fpv-необов-язково" aria-label="Permalink to &quot;FPV (необов&#39;язково)&quot;">​</a></h3><ul><li>Camera: <a href="https://www.getfpv.com/runcam-swift-rotor-riot-special-edition-ir-block-black.html" target="_blank" rel="noreferrer">RunCam Swift RR Edition</a> <strong>includes must-have high quality wide angle lens from GoPro!</strong></li><li>Video Tx: <a href="https://www.getfpv.com/immersionrc-tramp-hv-5-8ghz-video-tx-us-version.html" target="_blank" rel="noreferrer">ImmersionRC Tramp HV 5.8GHz 600mW</a> (Discontinued).</li><li>Video Antennas: <a href="http://www.getfpv.com/fpv/antennas/tbs-triumph-5-8ghz-cp-fpv-antenna-3275.html" target="_blank" rel="noreferrer">TBS Triumph 5.8GHz CP</a> (SMA port fits ImmercionRC Tx)</li><li>FPV voltage source plug: <a href="http://www.getfpv.com/male-jst-battery-pigtail-10cm-10pcs-bag.html" target="_blank" rel="noreferrer">Male JST Battery Pigtail</a></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>These parts cover the sending side for standard FPV 5.8GHz analog FM video. Для перегляду відеопотоку в реальному часі вам потрібен сумісний приймач і пристрій відображення.</p></div><h2 id="збирання-базовоі-рами" tabindex="-1">Збирання базової рами <a class="header-anchor" href="#збирання-базовоі-рами" aria-label="Permalink to &quot;Збирання базової рами&quot;">​</a></h2><p>Я зібрав основну центральну плату та руки, як показано у цьому відео між 09:25 та 13:26:</p>',9),r("lite-youtube",{videoid:"7SIpJccXZjM",title:"How to Build a Lumenier QAV-R"},null,-1),e('<p>Я закріпив чотири двигуни на рамі з кабелями, що виходять у напрямку центру рами. Я використав два з довших від винтів для мотора, які йдуть разом з рамою, для кожного мотора і вставив їх у дві отвори, які знаходяться далі один від одного.</p><h2 id="побудова-силовоі-передачі" tabindex="-1">Побудова силової передачі <a class="header-anchor" href="#побудова-силовоі-передачі" aria-label="Permalink to &quot;Побудова силової передачі&quot;">​</a></h2><p>Регулятори швидкості KISS відомі своєю високою продуктивністю, але вони також мають два недоліки:</p><ul><li>Використовуване програмне забезпечення не є відкритим джерелом (на відміну від BLHeli)</li><li>Немає апаратного пакету з попередньо припаяними дротами та/або вилками (наскільки мені відомо)</li></ul><p>Це означає, що нам потрібно злити принаймні 6 з&#39;єднань на кожному ESC, але це все ще повністю варте цього.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Always tin both sides you want to connect with solder before actually soldering them together. Це зробить його набагато простіше, і ймовірність холодних припояних швів буде меншою.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Make sure that you use an appropriate cable gauge for the power connections that transport the high current all the way from the battery to the motors. Всі сигнальні кабелі можуть бути дуже тонкими у порівнянні.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Put heat shrink on the cables before you start soldering! Після успішного функціонального тесту термоусадження регуляторів швидкості, модуля живлення та вільно плаваючих незізольованих припоєних з&#39;єднань захистить їх від бруду, вологи та фізичних пошкоджень.</p></div><h3 id="двигуни" tabindex="-1">Двигуни <a class="header-anchor" href="#двигуни" aria-label="Permalink to &quot;Двигуни&quot;">​</a></h3><p>Спочатку я відрізав всі три кабелі двигуна, щоб вони безпосередньо відповідали, коли регулятори швидкості монтуються на руки, зсунуті до центру, але все ще залишають достатньо вільного місця для легкого розміщення деталей і не створюють жодного напруження на кабелях. Потім я їх паяв у порядку, у якому вони виходять з мотора, на вихідні контакти регуляторів швидкості, які орієнтовані так, щоб перемикаючі MOS-FET-перетворювачі були спрямовані вгору для забезпечення хорошого охолодження повітрям під час польоту. Choosing this cable order resulted in all the motors spinning counter-clockwise in my tests and I switched where necessary the direction of rotation by bridging the dedicated <a href="https://1.bp.blogspot.com/-JZoWC1LjLis/VtMP6XdU9AI/AAAAAAAAAiU/4dygNp0hpwc/s640/KISS-ESC-2-5S-24A-race-edition-32bit-brushless-motor-ctrl.jpg" target="_blank" rel="noreferrer">JP1 solder jumper</a> to conform the <a href="./../airframes/airframe_reference.html#quadrotor-x">Quadrotor x configuration</a>.</p><p><img src="'+i+'" alt="Power motor connections"></p><h3 id="модуль-живлення" tabindex="-1">Модуль живлення <a class="header-anchor" href="#модуль-живлення" aria-label="Permalink to &quot;Модуль живлення&quot;">​</a></h3><p>First I soldered the XT60 connector which comes with the frame to the labeled battery side of the <em>ACSP5 power module</em> that was shipped with the Pixracer and added the elco capacitor delivered with the power module with the correct polarity to the same side.</p><p><img src="'+l+'" alt="ACSP5 power module"></p><p>Тепер настає складна частина. Я зварив всі чотири порти напруги ESC + та - до відповідного патча на позначеному боці виходу ESC модуля живлення. Переконайтеся, що тут немає жодного холодного припою, оскільки квадрокоптер не завершиться добре з вільним з&#39;єднанням у польоті. Використання додаткової плати розподілу потужності рами зробило би роботу набагато простіше, але також займає занадто багато місця на такій маленькій рамі...</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If you are also including the FPV parts don&#39;t forget to also solder your JST male power plug to the output side of the power module. You&#39;ll need it for your <a href="#fpv-setup">FPV setup</a> later on.</p></div><p><img src="'+n+'" alt="Power module"></p><h3 id="сигнальні-кабелі" tabindex="-1">Сигнальні кабелі <a class="header-anchor" href="#сигнальні-кабелі" aria-label="Permalink to &quot;Сигнальні кабелі&quot;">​</a></h3><p>Я використовував тонкі кабелі зі стандартизованим роз&#39;ємом заголовка шпильки, які були вирізані навпіл для сигналу ESC, оскільки це дозволить легко вставити їх на контакти Pixracer пізніше. Only the labeled <code>PWM</code> port on the <a href="https://1.bp.blogspot.com/-0huvLXoOygM/VtMNAOGkE5I/AAAAAAAAAiA/eNNuuySFeRY/s640/KISS-ESC-2-5S-24A-race-edition-32bit-brushless-motor-ctrl.jpg" target="_blank" rel="noreferrer">KISS ESCs</a> is necessary for flying. Вони будуть підключені до правильного вихідного сигналу двигуна pixracer. The <code>TLM</code> port is for ESC telemetry and I soldered them on for future use as the needed protocol is not currently supported by PX4.</p><p><img src="'+s+'" alt="Power ESC signals"></p><p>Я протестував всі пари моторів ESC та їх напрямки обертання за допомогою дешевого тестера PWM серво до продовження.</p><p><img src="'+c+'" alt="Motor test"></p><p><a id="mounting"></a></p><h2 id="connecting-mounting-electronics" tabindex="-1">Connecting &amp; Mounting Electronics <a class="header-anchor" href="#connecting-mounting-electronics" aria-label="Permalink to &quot;Connecting &amp; Mounting Electronics&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Double check the pin assignment of every component you connect. На жаль, не кожен апаратний компонент там є підключенням і грою, навіть якщо на перший погляд може здатися, що це так.</p></div><p>You&#39;ll need the <a href="./../flight_controller/pixracer.html">hardware documentation of the Pixracer</a> for this step to find all needed connectors. Я намагався прокласти всі кабелі під дошкою Pixracer, щоб мати чисту конструкцію та заощадити місце для камери FPV та передавача у майбутньому.</p><p>I mounted the Pixracer using the nylon spacers and screws that get shipped with the QAV-R frame but <strong>put some small O-rings</strong> between the board and the spacers to add a bit of vibration dampening. Make sure to <strong>not tighten the screws too much or little</strong>, do it such that the board clearly touches both sides but is not clamped with any tension. Дошка не повинна ніяк висіти, але трохи рухатися, якщо ви натиснете на неї пальцями.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This can heavily influence the vibration noise level your gyroscope and accelerometer sensors measure during flight.</p></div><p><img src="'+h+'" alt=""></p><p><img src="'+p+'" alt="Center connections"><img src="'+d+'" alt="Center overview"></p><h3 id="приимач-радіокерування" tabindex="-1">Приймач радіокерування <a class="header-anchor" href="#приимач-радіокерування" aria-label="Permalink to &quot;Приймач радіокерування&quot;">​</a></h3><p>Я підключив приймач FrSky S-BUS за допомогою кабелю, відправленого з Pixracer, але відгалуження з непотрібним кабелем відрізав.</p><p>Для розумного порту телеметрії я використав кабель, який поставляється з приймачем. Я видалив усі непотрібні шпильки з роз&#39;єму за допомогою пінцета і перемкнув білий вільний кінець кабелю на правильну шпильку роз&#39;єму, щоб мати підключений сигнал &quot;розумний&quot;. Потім я припаяв вільний кінець до кабельного вводу порту FrSky, дотримуючись цієї схеми:</p><p><img src="'+_+'" alt="schematic"></p><p>Я також пропустив земельний (GND) контакт, оскільки, подібно до позитивного контакту живлення напруги, він вже підключений через кабель RCin S-BUS.</p><p><img src="'+m+'" alt=""></p><h3 id="кріплення-антени-rc" tabindex="-1">Кріплення антени RC <a class="header-anchor" href="#кріплення-антени-rc" aria-label="Permalink to &quot;Кріплення антени RC&quot;">​</a></h3><p>Щоб мати хороше з&#39;єднання RC, не ризикуючи мати антену в гвинтах, я використовував метод міцного кріплення за допомогою термоусадки та затяжок.</p><p><img src="'+u+'" alt=""></p><p>Для цього методу ви відрізаєте великий кінець з отвором від застібки-ґудзика, складаєте решту разом з антенним кабелем через довгий термоусадку та монтуєте це на ваших рамних просторах, використовуючи більшу, але коротшу термоусадку.</p><p><img src="'+f+'" alt=""></p><h3 id="сигнал-esc" tabindex="-1">Сигнал ESC <a class="header-anchor" href="#сигнал-esc" aria-label="Permalink to &quot;Сигнал ESC&quot;">​</a></h3><p>For the ESC signals I followed the <a href="./../flight_controller/pixracer.html">hardware documentation of the Pixracer</a> and the <a href="./../airframes/airframe_reference.html#quadrotor-x">Quadrotor x configuration</a> motor numbering scheme. As we have no ground or positive BEC voltage connections we connect our <code>PWM</code> ESC signal cables each to its topmost pins of the corresponding output connector.</p><h3 id="gps-зовнішніи-магнітометр" tabindex="-1">GPS / Зовнішній магнітометр <a class="header-anchor" href="#gps-зовнішніи-магнітометр" aria-label="Permalink to &quot;GPS / Зовнішній магнітометр&quot;">​</a></h3><p>Я взяв кабель GPS, який підходить до роз&#39;єму використаного GPS і поставляється ​​з набором Pixracer. Sadly the pin assignment was completely wrong and I rewired the connector again using tweezers according to the <a href="./../flight_controller/pixhawk_mini.html#connector-pin-assignments-pin-outs">3DR Pixhawk Mini user manual</a> GPS port.</p><h4 id="pixracer-gps-i2c-port" tabindex="-1">Pixracer GPS/I2C Port <a class="header-anchor" href="#pixracer-gps-i2c-port" aria-label="Permalink to &quot;Pixracer GPS/I2C Port&quot;">​</a></h4><table tabindex="0"><thead><tr><th>Pin</th><th>Призначення</th></tr></thead><tbody><tr><td>1</td><td>GND</td></tr><tr><td>2</td><td>SDA</td></tr><tr><td>3</td><td>SCL</td></tr><tr><td>4</td><td>RX</td></tr><tr><td>5</td><td>TX</td></tr><tr><td>6</td><td>+5V</td></tr></tbody></table><h4 id="m8n-3dr-pixhawk-mini-gps-connector" tabindex="-1">M8N 3DR Pixhawk mini GPS Connector <a class="header-anchor" href="#m8n-3dr-pixhawk-mini-gps-connector" aria-label="Permalink to &quot;M8N 3DR Pixhawk mini GPS Connector&quot;">​</a></h4><table tabindex="0"><thead><tr><th>Pin</th><th>Призначення</th><th>Connect to Pixracer Pin</th></tr></thead><tbody><tr><td>1 (red)</td><td>SCL</td><td>3</td></tr><tr><td>2</td><td>SDA</td><td>2</td></tr><tr><td>3</td><td>VCC 5V</td><td>6</td></tr><tr><td>4</td><td>RX</td><td>5</td></tr><tr><td>5</td><td>TX</td><td>4</td></tr><tr><td>6</td><td>GND</td><td>1</td></tr></tbody></table><p>Я встановив модуль GPS, використовуючи перерахований загальний мультікоптерний стійку GPS, оскільки встановлення його ближче до основного корпусу зробило показання магнітометра абсолютно непридатними для використання. Експеримент, в якому модуль було прямо закріплено на далекому задньому краї рами, показав, що шум величини магнітометра в шість разів ймовірно спричинений магнітним полем струмів ESC. Зверніть увагу, що я скоротив мачту на ~2 см, щоб вона краще підходила за довжиною кабелю та розмірами рами. Модуль GPS приклеєний двостороннім скотчем до верхньої плити мачти.</p><h2 id="налаштування-fpv" tabindex="-1">Налаштування FPV <a class="header-anchor" href="#налаштування-fpv" aria-label="Permalink to &quot;Налаштування FPV&quot;">​</a></h2><p>Це інструкція для необов&#39;язкової передачі відео у реальному часі FPV на частоті 5,8 ГГц. Вам знадобляться додаткові частини FPV, перераховані в початковій частині. Трансляція FPV, описана тут, є електронно незалежною від контролера польоту, вона бере тільки напругу батареї після модуля живлення.</p><p>Спочатку я зробив контрольний тест, щоб переконатися, що все працює правильно. Для цього підключіть кабель відеосигналу, який постачається разом з вашим передавачем, і підключіть його до задньої частини вашої FPV-камери та до відповідного роз&#39;єму передавача. Закрутіть, а потім підключіть штекер живлення JST до вашого транспортного засобу або до іншого джерела напруги. Світлодіод передавача повинен загорітися. Використовуйте свій пристрій приймача 5,8 Ггц, налаштований на правильний канал, щоб перевірити відео. To configure the transmitter to an other channel and adjust the transmission power please refer to the <a href="https://www.immersionrc.com/?download=5016" target="_blank" rel="noreferrer">Tramp HV User Manual</a>.</p><p><img src="'+g+'" alt="FPV wiring"></p><p>Як ви можете побачити, я закріпив передавач зсередини на &quot;даху&quot; рами, використовуючи затискач. Завжди вставляйте самоклеючий шматок піни між, коли монтуєте електроніку, як цю, щоб уникнути фізичних пошкоджень під час польоту. Переконайтеся, що передавач розташований таким чином, щоб роз&#39;єм антени відповідав відведеній отвору рамки.</p><p><img src="'+b+'" alt="Transmitter"></p><p>Величезна камера FPV, встановлена в частині списку, має не лише найкращий об&#39;єктив FPV, який я бачив до цього, але також включає кілька кріплень для камери, одне з яких дуже гнучке для налаштування кута камери і гарно вписується в рамку QAV-R. Я змонтував це, як ви можете побачити на наступному зображенні. Два гвинти та гайки для фіксації кронштейну камери до рами були взяті з запасних, що залишилися від комплекту рами.</p><p><img src="'+w+'" alt="Camera"></p><h2 id="конфігурація-px4" tabindex="-1">Конфігурація PX4 <a class="header-anchor" href="#конфігурація-px4" aria-label="Permalink to &quot;Конфігурація PX4&quot;">​</a></h2><p><em>QGroundControl</em> is used to install the PX4 autopilot and configure/tune it for the frame. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Download and install</a> <em>QGroundControl</em> for your platform.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Full instructions for installing and configuring PX4 can be found in <a href="./../config/">Basic Configuration</a>.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Always make sure to have either battery or propellers physically removed from your vehicle during any initial configuration. Краще перестрахуватися, ніж потім шкодувати!</p></div><p>Спочатку оновіть прошивку, конструкцію та відображення актуаторів:</p><ul><li><p><a href="./../config/firmware.html">Firmware</a></p></li><li><p><a href="./../config/airframe.html">Airframe</a></p><p>You will need to select the <em>Generic 250 Racer</em> airframe (<strong>Quadrotor x &gt; Generic 250 Racer</strong>).</p><p><img src="'+P+'" alt="QGC airframe selection of generic 250 racer"></p></li><li><p><a href="./../config/actuators.html">Actuators</a></p><ul><li>Вам не потрібно оновлювати геометрію транспортного засобу.</li><li>Призначте функції приводу до актуаторів, щоб відповідати вашому підключенню.</li><li>Перевірте конфігурацію, використовуючи слайдери.</li></ul></li></ul><p>Потім виконайте обов&#39;язкове налаштування / калібрування:</p><ul><li><a href="./../config/flight_controller_orientation.html">Sensor Orientation</a></li><li><a href="./../config/compass.html">Компас</a></li><li><a href="./../config/accelerometer.html">Акселерометр</a></li><li><a href="./../config/level_horizon_calibration.html">Level Horizon Calibration</a></li><li><a href="./../config/radio.html">Radio Setup</a></li><li><a href="./../config/flight_mode.html">Flight Modes</a></li></ul><p>В ідеалі ви також повинні зробити:</p><ul><li><a href="./../advanced_config/esc_calibration.html">ESC Calibration</a></li><li><a href="./../config/battery.html">Battery Estimation Tuning</a><ul><li>4S (4 елементи LiPo) з напругою зарядженого елемента 4,15 В і напругою розрядженого елемента 3,5 В (або відповідні значення для вашого акумулятора).</li></ul></li><li><a href="./../config/safety.html">Safety</a></li></ul><h3 id="вдосконалення" tabindex="-1">Вдосконалення <a class="header-anchor" href="#вдосконалення" aria-label="Permalink to &quot;Вдосконалення&quot;">​</a></h3><p>Airframe selection sets <em>default</em> autopilot parameters for the frame. Ці вистачають для польоту, але це добра ідея налаштувати параметри для конкретної конструкції рами.</p><p>For instructions on how, start from <a href="./../config/autotune_mc.html">Autotune</a>.</p>',71)]))}const I=k(S,[["render",q]]);export{G as __pageData,I as default};
